import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import Card from '../../components/Card/Card';
import Input from '../../components/Input/Input';
import Button from '../../components/Button/Button';
import './Auth.css';

const Register = () => {
  const navigate = useNavigate();
  const [currentStep, setCurrentStep] = useState(1);
  const totalSteps = 4;
  
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    confirmPassword: '',
    role: 'student',
    sport: ''
  });

  const sports = [
    "Basketball",
    "Cricket",
    "Football",
    "Volleyball",
    "Athletics",
    "Badminton",
    "Table Tennis",
    "Swimming",
    "Chess",
    "Carrom",
    "Kabaddi",
    "Tennis"
  ];

  const roleDescriptions = {
    student: "Join as a student to access sports training, book sessions, and track your progress",
    coach: "Join as a coach to offer your expertise and connect with students"
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (formData.role === 'coach') {
      navigate('/coach/signup', { state: { sport: formData.sport } });
    } else {
      console.log('Register data:', formData);
    }
  };

  const handleNext = () => {
    if (currentStep < totalSteps) {
      setCurrentStep(prev => prev + 1);
    }
  };

  const handlePrev = () => {
    if (currentStep > 1) {
      setCurrentStep(prev => prev - 1);
    }
  };

  return (
    <div className="auth-container">
      <Card>
        <div className="progress-bar">
          {[...Array(totalSteps)].map((_, index) => (
            <div 
              key={index}
              className={`progress-step ${
                currentStep > index + 1 
                  ? 'completed' 
                  : currentStep === index + 1 
                  ? 'active' 
                  : ''
              }`}
            >
              {index + 1}
            </div>
          ))}
        </div>

        <div className={`form-step ${currentStep === 1 ? 'active' : ''}`}>
          <div className="step-content">
            <h2 className="step-title">Choose Your Role</h2>
            <p className="step-description">Are you joining as a student or coach?</p>
          </div>
          <div className="role-selector">
            <div className="role-options">
              <label className={`role-option ${formData.role === 'student' ? 'selected' : ''}`}>
                <input
                  type="radio"
                  name="role"
                  value="student"
                  checked={formData.role === 'student'}
                  onChange={handleChange}
                />
                <span>Student</span>
              </label>
              <label className={`role-option ${formData.role === 'coach' ? 'selected' : ''}`}>
                <input
                  type="radio"
                  name="role"
                  value="coach"
                  checked={formData.role === 'coach'}
                  onChange={handleChange}
                />
                <span>Coach</span>
              </label>
            </div>
            <p className="role-description">
              {roleDescriptions[formData.role]}
            </p>
          </div>

          <div className="form-nav">
            <button 
              className="nav-button next-button"
              onClick={handleNext}
            >
              Next
            </button>
          </div>
        </div>

        <div className={`form-step ${currentStep === 2 ? 'active' : ''}`}>
          <div className="step-content">
            <h2 className="step-title">Basic Information</h2>
            <p className="step-description">Tell us a bit about yourself</p>
          </div>
          
          <div className="input-group">
            <Input
              label="Full Name"
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
            />
          </div>

          <div className="input-group">
            <Input
              label="Email"
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-nav">
            <button 
              className="nav-button prev-button"
              onClick={handlePrev}
            >
              Previous
            </button>
            <button 
              className="nav-button next-button"
              onClick={handleNext}
            >
              Next
            </button>
          </div>
        </div>

      </Card>
    </div>
  );
};

export default Register;
